function Header(){
    return (
        <>
        <nav className="flex">
            <a href="#" className="brand">brand</a>
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Contact</li>
            </ul>
        </nav>
        </>
    )
}

export default Header
